import logo from './logo.svg';
import './App.css';
import TLAC from './tlac.js';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';

function App() {
  return (
    <div className="App">
      <Tabs
      defaultActiveKey="home"
      id="uncontrolled-tab-example"
      className="mb-3"
    >
      <Tab eventKey="home" title="Home">
        Home
      </Tab>
      <Tab eventKey="tlac" title="Home">
        <TLAC />
      </Tab>
      <Tab eventKey="other" title="Profile">
        <TLAC />
      </Tab>

    </Tabs>

    </div>
  );
}

export default App;
